  		$("head").append("<link>");
		$("head").children(":last").attr({
		  rel:  "stylesheet",
		  type: "text/css",
		  href: "http://ajax.googleapis.com/ajax/libs/jqueryui/1.8.8/themes/ui-darkness/jquery-ui.css"
		});
		var width = $("#watch-player").width();
		var height =  $("#watch-player").height();
		var prevWidth = width;
		$("#watch-player").css({"padding":"5px", "text-align":"center", "margin-left":"0px"}).resizable(); 
		$("#watch-video").css({"overflow":"visible"});
		//FF4 fix
		$("#watch-player").resize(function () {
			$(".html5-video-content").css({"width":"100%","height":"100%","left":"0px","top":"0px"}); //HTML5 video fix
			if($("#watch-player").width() < 970)
				width = 640;
			if($("#watch-player").width() > 640)
				$("#watch-sidebar").css({"margin":"0px"});
			else
				$("#watch-sidebar").css({"margin-top":-$("#watch-player").height()});
			if(width < $("#watch-player").width())
			{
				if($("div.watch-module").height() != height+5)
					$("div.watch-module").css("margin-top", height+5+"px");
				
				if($("#watch-player").width() > 970)
				{
					var offset = (width-$("#watch-player").width());
					if(prevWidth != $("#watch-player").width())
						$("#watch-player").width($("#watch-player").width()-offset);
					width = 970;
					if(prevWidth != $("#watch-player").width())
						if($("#watch-player").css("margin-left") != offset)
							$("#watch-player").css("margin-left", offset+"px");
				}
			}
			else
				$("div.watch-module").css("margin-top", 5+"px");
			prevWidth = $("#watch-player").width();
		});
